export default function Clicker(){
    const [count, setCount] = useState(0)

    const buttonClick = () =>{
        setCount(count + 1)
    }

    return <div>
        <div>Clicks: 0</div>
        <button onClick={buttonClick()}>Clicker</button>
    </div>
}
